  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  National Wildlife Refuge summarizes Refuge activities during the 1982 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  \ Land acquisition is also covered.  The report includes a planning section which
  discusses the master plan, the management plan, public participation, compliance
  with environmental and cultural resource mandates, research, and investigations.
  \ Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, volunteer programs, funding, safety, and technical assistance
  is given.  Habitat management is also covered.  Subjects include wetlands, forests,
  croplands, grasslands, grazing, haying, fire management, pest control, water rights,
  wilderness areas, and WPA easement monitoring.  The wildlife section of the report
  discusses wildlife diversity, endangered species, threatened species, waterfowl,
  marsh birds, waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  animal control, marking, banding, and disease control.  The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive exhibits, hunting,
  fishing, trapping, wildlife observation, camping, and law enforcement.  The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment utilization/replacement, communications
  systems, computer systems, and energy conservation.  Items of interest are provided
  at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
